import { RECEIVE_UNQUESTIONS } from '../actions/questions.js'

export default function questions ( state = [] , action) {
    switch (action.type) {
        case RECEIVE_UNANS_QUESTIONS :
            return {
                ...state,
                ...action.questions
            }
            default :
            return state
    }
}
